exports.started = (time) => {
	if (time >= '6' && time < '12') return `I finished the work ${os.userInfo().username} ❤️\nHave a great morning! 🌄`
	if (time >= '12' && time <= '18') return `I finished the work ${os.userInfo().username} ❤️\nHope it's a great afternoon! ☀️`
	if (time >= '18' && time < '0') return `I finished the work ${os.userInfo().username} ❤️\nToday we are going to have an amazing night! 🌃`
	if (time >= '0' && time < '6') return `I finished the work ${os.userInfo().username} ❤️\n It's time for an inspiring dawn! ✨`
}

